import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const VendorDashboard = () => {
  const [user, setUser] = useState(null);
  const [activeTab, setActiveTab] = useState('overview');
  const navigate = useNavigate();

  useEffect(() => {
    const userData = localStorage.getItem('user');
    if (userData) {
      try {
        const parsedUser = JSON.parse(userData);
        if (parsedUser.role !== 'RESTAURANT_OWNER') {
          navigate('/');
          return;
        }
        setUser(parsedUser);
      } catch (error) {
        console.error('Error parsing user data:', error);
        navigate('/login');
      }
    } else {
      navigate('/login');
    }
  }, [navigate]);

  if (!user) {
    return <div className="loading">Loading...</div>;
  }

  const renderTabContent = () => {
    switch (activeTab) {
      case 'overview':
        return (
          <div className="tab-content">
            <div className="stats-grid">
              <div className="stat-card">
                <div className="stat-icon">üìä</div>
                <div className="stat-info">
                  <h3>Today's Orders</h3>
                  <p className="stat-number">12</p>
                </div>
              </div>
              <div className="stat-card">
                <div className="stat-icon">üí∞</div>
                <div className="stat-info">
                  <h3>Today's Revenue</h3>
                  <p className="stat-number">‚Çπ2,450</p>
                </div>
              </div>
              <div className="stat-card">
                <div className="stat-icon">‚≠ê</div>
                <div className="stat-info">
                  <h3>Rating</h3>
                  <p className="stat-number">4.5</p>
                </div>
              </div>
              <div className="stat-card">
                <div className="stat-icon">üçΩÔ∏è</div>
                <div className="stat-info">
                  <h3>Menu Items</h3>
                  <p className="stat-number">25</p>
                </div>
              </div>
            </div>
            
            <div className="recent-orders">
              <h3>Recent Orders</h3>
              <div className="orders-list">
                <div className="order-item">
                  <div className="order-info">
                    <h4>Order #1234</h4>
                    <p>2 items ‚Ä¢ ‚Çπ350</p>
                  </div>
                  <div className="order-status pending">Pending</div>
                </div>
                <div className="order-item">
                  <div className="order-info">
                    <h4>Order #1233</h4>
                    <p>1 item ‚Ä¢ ‚Çπ150</p>
                  </div>
                  <div className="order-status completed">Completed</div>
                </div>
              </div>
            </div>
          </div>
        );
      
      case 'menu':
        return (
          <div className="tab-content">
            <div className="section-header">
              <h3>Menu Management</h3>
              <button className="btn btn-primary">Add New Item</button>
            </div>
            <div className="coming-soon">
              <h3>Menu Management Coming Soon</h3>
              <p>You'll be able to add, edit, and manage your menu items here.</p>
            </div>
          </div>
        );
      
      case 'orders':
        return (
          <div className="tab-content">
            <h3>Order Management</h3>
            <div className="coming-soon">
              <h3>Order Management Coming Soon</h3>
              <p>You'll be able to view and manage all your orders here.</p>
            </div>
          </div>
        );
      
      case 'analytics':
        return (
          <div className="tab-content">
            <h3>Analytics & Reports</h3>
            <div className="coming-soon">
              <h3>Analytics Coming Soon</h3>
              <p>You'll be able to view detailed analytics and reports here.</p>
            </div>
          </div>
        );
      
      default:
        return null;
    }
  };

  return (
    <div className="dashboard vendor-dashboard">
      <div className="container">
        <div className="dashboard-header">
          <div className="header-content">
            <h1>Vendor Dashboard</h1>
            <p>Welcome back, {user.firstName}! Manage your campus food business.</p>
          </div>
          <div className="vendor-info">
            <div className="vendor-avatar">üè™</div>
            <div className="vendor-details">
              <h3>{user.firstName}'s Kitchen</h3>
              <p>Campus Vendor</p>
            </div>
          </div>
        </div>

        <div className="dashboard-content">
          <div className="dashboard-sidebar">
            <nav className="dashboard-nav">
              <button 
                className={`nav-item ${activeTab === 'overview' ? 'active' : ''}`}
                onClick={() => setActiveTab('overview')}
              >
                <span className="nav-icon">üìä</span>
                Overview
              </button>
              <button 
                className={`nav-item ${activeTab === 'menu' ? 'active' : ''}`}
                onClick={() => setActiveTab('menu')}
              >
                <span className="nav-icon">üçΩÔ∏è</span>
                Menu
              </button>
              <button 
                className={`nav-item ${activeTab === 'orders' ? 'active' : ''}`}
                onClick={() => setActiveTab('orders')}
              >
                <span className="nav-icon">üì¶</span>
                Orders
              </button>
              <button 
                className={`nav-item ${activeTab === 'analytics' ? 'active' : ''}`}
                onClick={() => setActiveTab('analytics')}
              >
                <span className="nav-icon">üìà</span>
                Analytics
              </button>
            </nav>
          </div>

          <div className="dashboard-main">
            {renderTabContent()}
          </div>
        </div>
      </div>
    </div>
  );
};

